function bouton_pan() {
    m = localStorage.getItem("total_p");
    if (m != "0") {
        notif = `
            <a href="panier.html" class="button_link" id="but_pan">
                <button class="button_nav"><a href="panier.html" class="panier_link" title="Cliquez pour accéder à votre panier "><span class="emoji_panier">🗑</span> panier
                        <a id="notif">${localStorage.getItem("total_p")}</a>
                    </a>
                </button>
            </a>
        `;
    } else {
        notif = `
            <a href="panier.html" class="button_link" id="but_pan">
                <button class="button_nav"><a href="panier.html" class="panier_link" title="Cliquez pour accéder à votre panier "><span class="emoji_panier">🗑</span> panier
                    </a>
                </button>
            </a>
        `;
    }
    document.querySelector('.button_link').innerHTML = notif;
}

function ajout_panier() {

    quantite = document.getElementById('qte').value;
    coul = document.getElementById('clr').value;
    prix = document.getElementById('up').innerHTML;
    nprod = document.getElementById('lib').innerHTML;
    devise = document.getElementById('unit').innerHTML;
    pu = Number.parseFloat(prix);

    sourc_p = document.getElementById('imagedisp').src;

    if ((quantite == null) || (quantite == undefined) || (quantite == 0)) quantite = 1;
    if (quantite < 0) quantite *= (-1);
    pt = pu * quantite;

    j = localStorage.getItem("total_p");
    prod1 = localStorage.getItem("prod_panier");
    if (prod1 == null) {
        prod1 = " ";
    }
    if (coul.includes('sissez')) coul = " une couleur en stock";
    if (j == null) {
        j = '0';
        i = 0;
    } else {
        i = parseInt(j);
    }
    pa = "" + (i + 1);
    f = "prod-" + pa;

    prod = prod1 + `
        <tr id="prod-${pa}" class="produits-x">
        <td id="numero-${i+1}">${pa} </td>
        <td>${nprod}</td>
        <td>${coul} </td>
        <td>${prix}</td>
        <td>${quantite}</td>
        <td>${pt} ${devise}</td>
        <td><button onclick="modif_prod(${sourc_p},${f})" class="but_modif"><a target="_parent" href="affichage_produit.html">  📖🖊  </a></button></td>
        <td><button onclick="sup_prod('prod-${pa}')" class="but_sup"> 🚷 </button></td>
        </tr>
    `;
    localStorage.setItem("prod_panier", prod);
    //localStorage.setItem("prod_panier", '');
    i = i + 1;
    j = i + '';
    localStorage.setItem("delete-state", "0");
    localStorage.setItem("total_p", j);
    bouton_pan();
    return;
}

